import './App.css';
import Sidebar from './Sidebar';
import Chat from './Chat.js';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return <div className="App">
  <div className="app__body">

  <Router>
  <Sidebar />
  <Switch>
  <Route path="/rooms/:roomId">
    <Chat />
  </Route>
  <Route path="/">
  <Chat />
  </Route>
  </Switch>
 </Router>
  </div>
  </div>

}

export default App;
